  \"2013-12-07T09:04:23.846112\",\n\t\"name\": \"ambulance-service-areas\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"North Dakota statewide ambulance service
  area polygons. The data was created in 2011 to replace an earlier dataset that was
  obsolete and contained topology errors. The dataset was compiled from the following
  data sources: North Dakota state maintained county boundaries, ambulance service
  area shapefiles provided by some counties, PDF files provided by some counties that
  showed ambulance service boundaries, and a shapefile from Bullberry Services.nnUpdate
  3/30/2012: Additional attributes were added to the data to show total area of each
  ASA in square miles and the total population for each ASA based on the 2010 US Census.
  The following methodologies were used:nnUpdate 3/30/2012: To calculate area in square
  miles, the calculation was made in ArcGIS Desktop within a data frame where the
  projection was set to Albers Equal Area in order to preserve area and obtain accurate
  calculations.nnUpdate 3/30/2012: To calculate population totals for each ASA, the
  following method was used. A shapefile was obtained from the US Census that contained
  census block geometry with population totals for each block. For each ASA, a spatial
  query was performed where all census blocks whose geographic centroid was within
  the ASA were selected. The total population for each of these selected census blocks
  was then summed and appended to the ASA in question. The resulting population totals
  for each ASA can be considered as very close approximations of the actual population
  totals. This is because census block polygons do not precisely match ASA boundaries.
  In most cases ASA boundaries and census block boundaries do match each other but
  in some cases they do not. In such cases, the total for the block in question is
  added to the sum of the ASA where the block centroid falls within. Because census
  block geographies are much smaller than ASA geographies, the \"error\" introduced
  with this method is estimated to be small. Furthermore, given available data, this
  is considered the best approximation of the true total polulation for each ASA short
  of conduction a new census based on ASA polygons.\",\n\t\"license_title\": null,\n\t\"extras\":
